import React from "react";
import CarexLogo from "../../assets/img/carex_logo.png";

const samplePosts = [
  {
    id: 1,
    user: {
      name: "Carex Angola",
      profileImage: CarexLogo,
      occupation: "Despachante e Transportadora",
    },
    content: "Este é um post de exemplo.",
    image: CarexLogo,
  },
  {
    id: 2,
    user: {
      name: "João Silva",
      profileImage: "https://via.placeholder.com/150",
      occupation: "Desenvolvedor Web",
    },
    content: "Outro post interessante.",
    image: "https://via.placeholder.com/400",
  },
];

export function MainPost() {
  return (
    <div className="main-post-container bg-gray-900 border border-gray-700 rounded-md p-4">
      {samplePosts.map((post) => (
        <div key={post.id} className="post-item mb-4">
          <div className="user-info flex items-center mb-1">
            <img src={post.user.profileImage} alt="" className="w-12 h-12 rounded-full" />
            <div className="user-details ml-4">
              <span className="user-name text-white font-semibold cursor-pointer">{post.user.name}</span>
              <span className="user-occupation text-gray-400 text-sm">{post.user.occupation}</span>
            </div>
          </div>
          <div className="post-content text-white mb-2">
            <p>{post.content}</p>
            {post.image && <img src={post.image} alt="Post" className="w-full" />}
          </div>
          <div className="post-actions flex justify-between items-center">
            <button className="text-blue-400 text-sm">Curtir</button>
            <button className="text-blue-400 text-sm">Compartilhar</button>
          </div>
        </div>
      ))}
    </div>
  );
}
